    "    u20.assign((grav*Ad*kw/omeg)*sin(-omeg*t)) # \n",
    "    Fetafluxbcl = thetaa*Hx*(n[0] * (u20)) + (1-thetaa)*Hx*(n[0] * (uve0)) # specified on ghost side\n",
