    "        nnm = nnm+1\n",
    "        eta12 = np.array([eta0.at(x) for x in xvals]) # eta12 = np.array([eta0.at(x) for x in xvals])\n",
    "        phi12 = np.array([uve0.at(x) for x in xvals])\n",
    "        ax1.plot(Ls*xvals,H0s*(H0+eta12)) #, color[int(i-1)],label = f' $\\eta_n: t = {t:.3f}$')\n",
